import Typography from '@mui/material/Typography';

const ItemListContainer = ({greetings}) => 
    <Typography
        variant="h1"
        noWrap
        sx={{
        fontFamily: 'monospace',
        fontWeight: 700,
        letterSpacing: '.3rem',
        color: 'inherit',
        textDecoration: 'none',
        }}
        align="center"
    >
        {greetings}
    </Typography>





export default ItemListContainer;
